window.bookSummaryJSON = "<p>In a single moment, everything changes. Seventeen-year-old Mia has no memory of the accident; she can only recall riding along the snow-wet Oregon road with her family. Then, in a blink, she finds herself watching as her own damaged body is taken from the wreck.</p> <p>A sophisticated, layered, and heartachingly beautiful story about the power of family and friends, the choices we all make - and the ultimate choice Mia commands.</p>"; 
